import React from 'react';
import PokemonThumb from './PokemonThumb';
const Grid = ({ pokemons }) => {
    console.log(pokemons);
    const createThumb = (pokemons) => {
        for (let element of pokemons.pokemons) {
            <PokemonThumb image={element.sprites.front_default} />
        }



    };

    return (
        <div className='m-0 px-5 py-0 flex flex-col w-screen align-center'>
            grid here
            {
                createThumb(pokemons)

            }
        </div>
    )
}

export default Grid;
